import React from 'react'
import "./stylesheets/App.css"
import Home from "./Containers/Home";


class App extends React.Component {

    state = {
        current_href: ''
    }


    onClickHandler = (page) => {
        console.log(page)
    }


    render() {
        return (
            <>
                <Home onClickHandler={this.onClickHandler}/>
            </>
        );
    }

}

export default App
